import React from 'react';
import styled from 'styled-components';

const StyledSlideSix = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  #white-car {
    position: absolute;
    bottom: 8vh;
    left: 18vw;
    width: 60vw;
  }

  #yellow-block {
    height: 80vh;
    width: 40vw;
    background: #FAC943;
    position: absolute;
    left:  80px;
    top: 0px;

    #customer-img {
      height: 75vh;
      transform: scaleX(-1);
      position: absolute;
      bottom: 1px;
      left: 5vh;
    }
  }
`;

function SlideSix() {
  return (
    <StyledSlideSix className="stickyroll-content">
      <div id='yellow-block'>
        <img id='customer-img' src='images/alex.png' alt='customer' /> 
      </div>
      <img id='white-car' src='images/white_car_right.png' alt='white sports car' />
    </StyledSlideSix>
  );
}

export default SlideSix;
